import React, {Component} from "react";

class AntiHeroeBox extends Component
{
    render(){
        return(
            <div>
                <h1>Mi Nombre es: {this.props.name} y yo soy {this.props.villano}</h1>
            </div>
        )
    }
}

export default AntiHeroeBox;
